@649Speedy disheartening to see such a clean crown on the E2 floor. Think that is more telling than the other numbers...

Previous E2s on the floor were whack looking... to see my brother just sitting there is crazy.

devs doooo something

@andrwwang I think its a lack of clarity around who owns the 'art' w/o a legal contract dictating the terms. 

Yes, WR went to the artist with the idea... but it was the artist who created the initial works that formed the basis of the project. 

Who is right? IDK
